import React from 'react'
import NoteContext from '../context/notes/notesContext'

const Notes = () => {
    const context = useContext(NoteContext);
    const { notes, setNotes } = context;
    return (
        <div className='container my-3'>
            <h2>Your Notes</h2>
            {notes.map((note) => {
                return note.title
            })}
        </div>
    )
}

export default Notes;
